import React, { useState } from 'react';

const Vehicles = () => {
  const [activeTab, setActiveTab] = useState('London');

  const openCity = (event, cityName) => {
    setActiveTab(cityName);
  };

  return (
    <div className='vehicles-div'>
      <div className="tab">
        <button
          className={`tablinks ${activeTab === 'London' ? 'active' : ''}`}
          onClick={(event) => openCity(event, 'London')}
        >
          London
        </button>
        <button
          className={`tablinks ${activeTab === 'Paris' ? 'active' : ''}`}
          onClick={(event) => openCity(event, 'Paris')}
        >
          Paris
        </button>
        <button
          className={`tablinks ${activeTab === 'Tokyo' ? 'active' : ''}`}
          onClick={(event) => openCity(event, 'Tokyo')}
        >
          Tokyo
        </button>
      </div>

      <div id="London" className={`tabcontent ${activeTab === 'London' ? 'show' : ''}`}>
        <h3>Londond</h3>
        <p>London is the capital city of England.</p>
      </div>

      <div id="Paris" className={`tabcontent ${activeTab === 'Paris' ? 'show' : ''}`}>
        <h3>Paris</h3>
        <p>Paris is the capital of France.</p>
      </div>

      <div id="Tokyo" className={`tabcontent ${activeTab === 'Tokyo' ? 'show' : ''}`}>
        <h3>Tokyo</h3>
        <p>Tokyo is the capital of Japan.</p>
      </div>
    </div>
  );
};

export default Vehicles;
